import React from "react";
import PropTypes from 'prop-types';
class Say extends React.Component {

    render() {
        return (
            <>
            <ul>
            <li>姓名：{this.props.stuInfo.name}</li>
                <li>年龄：{this.props.stuInfo.age}</li>
                <li>性别：{ this.props.stuInfo.gender}</li>
        </ul>
        </>
        );
    }
}

Say.defaultProps = {
    stuInfo:{
        name: "kiki",
        age: 18,
        gender:"man"
    }
}

export default Say;
